(2099, 152, 'MILKMAID Watalappam Recipe kit', 'MILKMAID Watalappam Recipe?kit', 'MILKMAID Watalappam Recipe?kit', 'MILKMAID Watalappam Recipe?kit', '<div id=\"short_description_content\" class=\"value\" itemprop=\"description\"><p>&nbsp; &nbsp;Ingredients</p>\n<ul>\n<li>MILKMAID-510g</li>\n<li>Jaggery-300g</li>\n<li>Cardamom-10g</li>\n<li>Eggs-10 Pack</li>\n<li>Vanilla Essence (Motha) - 20ml</li>\n<li>Cashew - 50g</li>\n</ul>\n<p><span style=\"color: #ff0000;\">FREE BOWL PROVIDED</span></p>\n<p>&nbsp;\"MILKMAID and Nestlé Lanka PLC does not bear any responsibility in respect of the quality or the freshness of the ingredients provided other than for MILKMAID provided with the order.\"</p></div><div class=\"value\"><p><b>MILKMAID Watalappam Recipe Kit Delivery - Terms &amp; Conditions</b></p>\n<div align=\"center\"><hr align=\"center\" noshade=\"noshade\" size=\"2\" width=\"100%\"></div>\n<ul>\n<li>MILKMAID Watalappam Recipe Kit Delivery service will be managed by “ Direct2Door “(“D2D”) delivery service</li>\n<li>Direct2Door&nbsp;will ensure the purchase and delivery of finest quality fresh ingredients</li>\n<li>Free delivery is available only for the mentioned areas in the grid. However we will be expanding our delivery services in the future.</li>\n<li>MILKMAID or Nestle Lanka does not bear any responsibility in respect of the quality or the freshness of the ingredients provided other than products of MILKMAID.</li>\n<li>Delivery is available from 10.00 am – 7.00 pm</li>\n<li>Orders need to be placed 4 hours before the expected delivery time.</li>\n<li>Agents of Direct2Door&nbsp;will contact and confirm the orders before delivery.</li>\n<li>Payments can be made through cash/card(Visa/Master) on delivery.</li>\n<li>For any feedback please contact Direct2Door on 0117556600</li>\n<li>In case of a late delivery, the delivery charge will neither be voided nor refunded.</li>\n<li>If you fail to accept delivery of Goods at the time they are ready for delivery, or we are unable to deliver at the nominated time due to your failure to provide appropriate instructions, or authorizations, then such goods shall be deemed to have been delivered to you and all risk and responsibility in relation to such goods shall pass to you. Any storage, insurance and other costs which we incur as a result of the inability to deliver shall be your responsibility and you shall indemnify Direct2Door&nbsp;in full for such cost.</li>\n<li>In the unlikely event that D2D delivers a wrong item, you have the right to reject the delivery of the wrong item and you shall be fully refunded for the missing item.</li>\n<li>All prices are in Sri Lanka Rupees.</li>\n<li>These Terms and Conditions shall be governed and construed in accordance with the laws of Sri Lanka. Both we, and you, hereby submit to the exclusive jurisdiction of the Courts of Sri Lanka. All dealings, correspondence and contacts between us shall be made or conducted in the English language.</li>\n</ul></div>', NULL, 1218, 1218, 2099, '1', '/products-images/milkmaid-watalappam-recipe-kit.png', NULL, '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0, 0, 'milkmaid-wattalapam-recipe-kit.html', '0', 0),
